import React from 'react'
import {Button, makeStyles, StylesProvider, Table, TableBody, TableCell, TableHead, TableRow} from '@material-ui/core'

const styleClass=makeStyles({
    createButton:{
        background:"#438BE8",
        color:"white",
        margin:20,
        width:200
    },
    Table:{
        border:'1px solid'
    }
})

function Categories() {
    const categoryarray=['Music','Movies','Sports','Fashion','Tech']
    const styles=styleClass()
    return (
        <>
        <Button variant="contained" className={styles.createButton} >CREATE BLOG
        </Button>

       
        <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Popular Categories
                    </TableCell>    
                </TableRow>
            </TableHead>

            <TableBody>
                {categoryarray.map(category=>(
                    <TableRow>
                    <TableCell>{category}</TableCell>
                    </TableRow>
                ))}
            </TableBody>
        </Table>
        

        </>
    )
}

export default Categories
